public class Solution {
    public int[] ReplaceElements(int[] arr) {
      int max = -1;
      for (int i = arr.Length - 1; i >= 0; i--) {
          int newMax = Math.Max(max, arr[i]);
          arr[i] = max;
          max = newMax;
      }
      return arr;
    }
}